import { SwipeableDrawer } from "@material-ui/core";
import TinderCard from "react-tinder-card";
import React, { useState } from "react";
import "./PinderCards.css";

function PinderCards() {
    const [animal, setAnimal] = useState([
        {
            name: 'Maku',
            url: "https://images.pexels.com/photos/1108099/pexels-photo-1108099.jpeg?cs=srgb&dl=pexels-chevanon-photography-1108099.jpg&fm=jpg",
        },
        {
            name: 'Lola',
            url: "https://images.pexels.com/photos/1108099/pexels-photo-1108099.jpeg?cs=srgb&dl=pexels-chevanon-photography-1108099.jpg&fm=jpg",
        },
    ]);

    const swiped = (direction, nameToDelete) => {
        console.log("removing" + nameToDelete);
    }

    const outOfFrame = (name) => {
        console.log(name+"left the screen ");
    }

    return <div className="pinderCards">
        <div className = "pinderCards__cardContainer">
            {animal.map((animal) => (
                <TinderCard
                className="swipe"
                key={animal.name}
                preventSwipe={["up","down"]}
                onSwipe={(dir) => swiped(dir, animal.name)}
                onCardLeftScreen={() => outOfFrame(animal.name)}>
                </TinderCard>
            ))}
        </div>
    </div>;
}

export default PinderCards;
